import React from 'react';
import NavigationPage from "./NavigationPage";


class PropsDemo extends React.Component {

    constructor(props) {
        super(props);

    }

    componentDidMount() {
        fetch("propsContent")
        .then(r => r.text())
        .then(text => {
            console.log('text decoded:', text);
        });
    }
    render() {
        return(
            <div>
            <NavigationPage project="React Training"></NavigationPage>
            <div>Props Value</div>
            <label>{this.props.value}</label>
            <code>{this.state.content}</code>
            </div>
        );
    }
}

export default PropsDemo;
